  true,\n\t\"url\": null,\n\t\"notes\": \"Completed in December 2014, the NASA Building
  12 installation consists of four Urban Green Energy Eddy GT turbines. The NASA Building
  12 project involved detailed pre-construction and post-construction measurements.
  NREL researchers initiated a measurement campaign consisting of multiple rooftop
  anemometers and other atmospheric instrumentation located on the prospective turbine
  pad mounts and in the immediate rooftop vicinity. The Building 12 measurement program
  consisted of two phases: Phase 1 is the pre-construction measurement campaign, and
  Phase 2 is the post-construction measurement campaign. The power data for Phase
  2 were measured by the NASA enterprise Supervisory Control and Data Acquisition
  system and contain inputs directly from the turbine inverters. Phase 2 data collection
  is ongoing, as of December 2015.\",\n\t\"license_title\": \"Creative Commons Attribution\",\n\t\"extras\":
